import * as React from "react";
import { SafeAreaView, StatusBar } from "react-native";
import AppRoute from "./src/app/routes";

export default function App() {
  return (
    <>
      <StatusBar barStyle="default" translucent="true" />
      <SafeAreaView>
        <AppRoute />
      </SafeAreaView>
    </>
  );
}
